INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (1, 'Feature A', 'Allons-y! People assume that time is a strict progression of cause-and-effect... but actually, from a non-linear, non-subjective viewpoint, it\'s more like a big ball of wibbly-wobbly... timey-wimey... stuff. I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. You need to get yourself a better dictionary. When you do, look up \'genocide\'. You\'ll find a little picture of me there, and the caption\'ll read \'Over my dead body\'. You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords.', 1, '2018-05-17 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 1, 2, 'OPEN', 3, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (2, 'Feature B', 'Blimey, trying to make an Ood laugh... I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. I\'d call you a genius, except I\'m in the room. Please, when Torchwood comes to write my complete history, don\'t tell people I travelled through time and space with her mother! You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords. New-new-Doctor. Don\'t you think she looks tired? Oh, yes. Harmless is just the word: that\'s why I like it! Doesn\'t kill, doesn\'t wound, doesn\'t maim. But I\'ll tell you what it does do: it is very good at opening doors!', 2, '2018-05-18 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 1, 1, 'CLOSED', 5, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (3, 'Feature C', 'I need...I need...I need... fish fingers and custard! Please tell me I didn\'t get old. Anything but old. I was young! Oh... is he grey? Frightened people. Give me a Dalek any day. No idea. Just do what I do: hold tight and pretend it\'s a plan. Usually called \'The Doctor.\' Or \'The Caretaker.\' Or \'Get off this planet.\' Though, strictly speaking, that probably isn\'t a name. I know. Dinosaurs! On a spaceship! Overconfidence, this, and a small screwdriver. I�m absolutely sorted. I once spent a hell of a long time trying to get a gobby Australian to Heathrow airport.', 3, '2018-05-19 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 1, 1, 'OPEN', 2, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (4, 'Feature D', 'Oh, I always rip out the last page of a book. Then it doesn\'t have to end. I hate endings! Usually called \'The Doctor.\' Or \'The Caretaker.\' Or \'Get off this planet.\' Though, strictly speaking, that probably isn\'t a name. It\'s a fez. I wear a fez now. Fezzes are cool. I once spent a hell of a long time trying to get a gobby Australian to Heathrow airport. I know. Dinosaurs! On a spaceship! There are fixed points throughout time where things must stay exactly the way they are. This is not one of them. This is an opportunity! Whatever happens here will create its own timeline, its own reality, a temporal tipping point. The future revolves around you, here, now, so do good!', 4, '2018-05-20 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 1, 4, 'CLOSED', 5, '1973-01-06 00:00', '1973-01-06 00:00');
