INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (21, 'Feature B', 'Blimey, trying to make an Ood laugh... I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. I\'d call you a genius, except I\'m in the room. Please, when Torchwood comes to write my complete history, don\'t tell people I travelled through time and space with her mother! You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords. New-new-Doctor. Don\'t you think she looks tired? Oh, yes. Harmless is just the word: that\'s why I like it! Doesn\'t kill, doesn\'t wound, doesn\'t maim. But I\'ll tell you what it does do: it is very good at opening doors!', 2, '2018-06-06 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 5, 4, 'OPEN', 3, '1973-01-06 00:00', '1973-01-06 00:00');
