INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (45, 'Feature A', 'Allons-y! People assume that time is a strict progression of cause-and-effect... but actually, from a non-linear, non-subjective viewpoint, it\'s more like a big ball of wibbly-wobbly... timey-wimey... stuff. I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. You need to get yourself a better dictionary. When you do, look up \'genocide\'. You\'ll find a little picture of me there, and the caption\'ll read \'Over my dead body\'. You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords.', 1, '2018-06-30 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 10, 1, 'OPEN', 1, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (46, 'Feature B', 'Blimey, trying to make an Ood laugh... I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. I\'d call you a genius, except I\'m in the room. Please, when Torchwood comes to write my complete history, don\'t tell people I travelled through time and space with her mother! You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords. New-new-Doctor. Don\'t you think she looks tired? Oh, yes. Harmless is just the word: that\'s why I like it! Doesn\'t kill, doesn\'t wound, doesn\'t maim. But I\'ll tell you what it does do: it is very good at opening doors!', 2, '2018-07-01 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 10, 2, 'CLOSED', 3, '1973-01-06 00:00', '1973-01-06 00:00');
