INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (69, 'Feature E', 'Overconfidence, this, and a small screwdriver. I�m absolutely sorted. It\'s a fez. I wear a fez now. Fezzes are cool. Geronimo! Father Christmas. Santa Claus. Or, as I�ve always known him, Jeff. I know. Dinosaurs! On a spaceship! No. You\'re too short and bossy, and your nose is all funny. Goodbye, Clara. You are the only mystery worth solving. Bow ties are cool. Come along, Pond! No idea. Just do what I do: hold tight and pretend it\'s a plan. There are fixed points throughout time where things must stay exactly the way they are. This is not one of them. This is an opportunity! Whatever happens here will create its own timeline, its own reality, a temporal tipping point. The future revolves around you, here, now, so do good!', 5, '2018-07-24 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 14, 4, 'OPEN', 1, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (70, 'Feature A', 'Allons-y! People assume that time is a strict progression of cause-and-effect... but actually, from a non-linear, non-subjective viewpoint, it\'s more like a big ball of wibbly-wobbly... timey-wimey... stuff. I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. You need to get yourself a better dictionary. When you do, look up \'genocide\'. You\'ll find a little picture of me there, and the caption\'ll read \'Over my dead body\'. You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords.', 1, '2018-07-25 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 15, 2, 'CLOSED', 3, '1973-01-06 00:00', '1973-01-06 00:00');
INSERT INTO `rafr`.`feature` (`id`, `title`, `description`, `clientPriority`, `targetDate`, `ticketUrl`, `client`, `productArea`, `status`, `createdBy`, `createdAt`, `updatedAt`) VALUES (71, 'Feature B', 'Blimey, trying to make an Ood laugh... I\'m Dr. James McCrimmon from the township of Balamory. I\'m sorry. I\'m so sorry. I\'d call you a genius, except I\'m in the room. Please, when Torchwood comes to write my complete history, don\'t tell people I travelled through time and space with her mother! You can spend the rest of your life with me, but I can\'t spend the rest of mine with you. I have to live on. Alone. That\'s the curse of the Time Lords. New-new-Doctor. Don\'t you think she looks tired? Oh, yes. Harmless is just the word: that\'s why I like it! Doesn\'t kill, doesn\'t wound, doesn\'t maim. But I\'ll tell you what it does do: it is very good at opening doors!', 2, '2018-07-26 0:39', 'https:--github.com/nick-freitas/ReallyAwesomeFeatureRequests/issues/8', 15, 1, 'OPEN', 1, '1973-01-06 00:00', '1973-01-06 00:00');
